import styled from "styled-components";

export const AboutPageContainer = styled.div`
    min-height: 100%;
    color: #D64933;
    display: block;
`;

export const Photo = styled.img`
    border-radius: 50%;
    border: solid 10px white;
    z-index: 1;
    position: sticky;
    bottom: 100px;   
`;

export const PhotoBackground = styled.div`
    width: 100%;
    background: grey;
    opacity: .7;
    height: 250px;
`
